import styled from 'styled-components'
import * as appStyles from '../appStyle'


export const Content = styled.div`
    display : flex;
    flex-direction : column;
    height : 100%;
    margin : 40px 40px;

    h5{
        font-size : 24px;
        color : ${appStyles.mainText}
    }

    .contentWrap{
        display : flex;
        flex-flow : row wrap;
        justify-content : space-between;
        align-items: center;
        margin-top : 40px;
        width: 100%;
    }

    .contentItem{
        width: 30%;
        height : 400px;
        box-shadow : ${appStyles.shadow};
        border-radius: 16px;
        margin-bottom : 24px;

        img{
            border-radius: 16px 16px 0  0;
            width : 100%;
            height : 264px;
            object-fit : cover;
        }
    }
`
